import React, { useState } from 'react';

// Lightweight editor for 4-week cycle: week13 (weeks 1 & 3) and week24 (weeks 2 & 4)
// Allows editing common meals and per-day overrides.
const dayKeys = ['monday','tuesday','wednesday','thursday','friday','saturday','sunday'];
const mealKeys = ['breakfast','lunch','snacks','dinner'];

function ensureStructure(cycle){
  if(!cycle) cycle = { type:'4-week', startDate:'', weeks:{ week13:{common:{},days:{}}, week24:{common:{},days:{}} } };
  ['week13','week24'].forEach(w=>{
    if(!cycle.weeks[w]) cycle.weeks[w]={common:{},days:{}};
    mealKeys.forEach(m=>{ if(cycle.weeks[w].common[m]===undefined) cycle.weeks[w].common[m]=''; });
    dayKeys.forEach(d=>{
      if(!cycle.weeks[w].days[d]) cycle.weeks[w].days[d]={};
      mealKeys.forEach(m=>{ if(cycle.weeks[w].days[d][m]===undefined) cycle.weeks[w].days[d][m]=''; });
    });
  });
  return JSON.parse(JSON.stringify(cycle));
}

const MenuEditorModal = ({ value, onSave, onClose }) => {
  const [cycle,setCycle] = useState(()=>ensureStructure(value));

  function updateCommon(week, meal, val){
    setCycle(c=>{ const n=ensureStructure(c); n.weeks[week].common[meal]=val; return n; });
  }
  function updateDay(week, day, meal, val){
    setCycle(c=>{ const n=ensureStructure(c); n.weeks[week].days[day][meal]=val; return n; });
  }

  function handleSave(){
    onSave(cycle);
  }

  return (
    <div className="modal-backdrop" role="dialog" aria-modal="true">
      <div className="modal large">
        <div className="modal-header">
          <h3>Edit Menu Cycle</h3>
          <button className="icon-btn" onClick={onClose}>âœ•</button>
        </div>
        <div style={{display:'flex', gap:'1rem', flexWrap:'wrap'}}>
          {['week13','week24'].map(week => (
            <div key={week} style={{flex:'1 1 420px', minWidth:360}}>
              <h4 style={{margin:'8px 0'}}>{week==='week13'?'Week 1 & 3':'Week 2 & 4'} - Common</h4>
              {mealKeys.map(meal => (
                <div key={meal} className="field-row">
                  <label>{meal}</label>
                  <textarea rows={2} value={cycle.weeks[week].common[meal]} onChange={e=>updateCommon(week,meal,e.target.value)} />
                </div>
              ))}
              <details style={{marginTop:8}}>
                <summary>Per-day overrides</summary>
                {dayKeys.map(day => (
                  <div key={day} className="day-edit-block">
                    <strong style={{textTransform:'capitalize'}}>{day}</strong>
                    {mealKeys.map(meal => (
                      <div key={meal} className="field-row small">
                        <label>{meal}</label>
                        <textarea rows={2} placeholder="(inherit common if blank)" value={cycle.weeks[week].days[day][meal]} onChange={e=>updateDay(week,day,meal,e.target.value)} />
                      </div>
                    ))}
                  </div>
                ))}
              </details>
            </div>
          ))}
        </div>
        <div className="modal-footer">
          <button className="secondary-btn" onClick={onClose}>Cancel</button>
          <button className="primary-btn" onClick={handleSave}>Save</button>
        </div>
      </div>
    </div>
  );
};

export default MenuEditorModal;
